          <div class="col-sm-3">
          <h1>
          Enfant
          </h1>
          </div>
          <div className="col-sm-3">un droit pour les pauvres </div>
          <div class="col-sm-6">

          </div>





        </div>
      </div>

    );
  }
}

export default Landing;
